using System.Text;
using System.Threading.Tasks;

namespace AlgorithmCSharp.Algorithm.KMP
{
    public class Test
    {
        public void Start()
        {
            KMP kmp = new KMP();
            string s, t;
            int result, answer;
            int id = -1;

            // 1.
            s = "sadbutsad"; t = "sad";
            answer = 0; result = kmp.CharIndex_KMP(s, t);
            Console.WriteLine($"{++id,2}: {result == answer}, result: {result}, answer: {answer}");

            // 2.
            s = "leetcode"; t = "letto";
            answer = -1; result = kmp.CharIndex_KMP(s, t);
            Console.WriteLine($"{++id,2}: {result == answer}, result: {result}, answer: {answer}");

            // 3.
            s = "";
            t = "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaab";
            answer = 9795; result = kmp.CharIndex_KMP(s, t);
            Console.WriteLine($"{++id,2}: {result == answer}, result: {result}, answer: {answer}");
        }
    }
